Events.ControlsEvents:
//Function for rbType0_CheckedChanged
public void rbType0_CheckedChanged ()
{
	if (rbType0.Checked)
	  {
		GroupBox___Standard_journal_selection.Enabled = false;
		GroupBox___Recurring_journal_selection.Enabled = false;
		grpRecurringAuthJournals.Enabled = false;
		GroupBox___Normal_journal_selection.Enabled = true;
		GroupBox___Ledge_year_selection.Enabled = true;
		GroupBox___Period_selection.Enabled = true;
		grpAuthorizedJournals.Enabled = true;
		GroupBox___Journal_type_selection.Enabled = true;
		GroupBox___Journal_status_selection.Enabled = true;
		GroupBox___Sub_module_journals.Enabled = true;
	  }
}
//Function for Form_Load
public void Form_Load ()
{
	rbType0_CheckedChanged ();
	rbType1_CheckedChanged ();
	rbType2_CheckedChanged ();
	cboJournalNumberSelection_SelectedIndexChanged ();
	cboRecurringJournalSelection_SelectedIndexChanged ();
	cboStandardJournalSelection_SelectedIndexChanged ();
	cboPeriodSelection_SelectedIndexChanged ();
	txtSYear1.Text = GenCurrentYear;
	//Create Buttons
	Button btnSelectAll = new Button();
	btnSelectAll.Text = SelectAll;
	btnSelectAll.Location = new Point(160,15);
	btnSelectAll.Click += new EventHandler(btnSelectAll_Click);
	btnSelectAll.TabIndex = 6;
	GroupBox___Journal_type_selection.Controls.Add(btnSelectAll);
	Button btnDeSelectAll = new Button();
	btnDeSelectAll.Text = DeselectAll;
	btnDeSelectAll.Location = new Point(160,40);
	btnDeSelectAll.TabIndex = 7;
	btnDeSelectAll.Click += new EventHandler(btnDeSelectAll_Click);	
	GroupBox___Journal_type_selection.Controls.Add(btnDeSelectAll);
	chkUpdatePrintedFlag.Checked = true;
	chkUpdatePrintedFlag.Visible = false;

	Button btnSelectAll1 = new Button();
	btnSelectAll1.Text = SelectAll;
	btnSelectAll1.Location = new Point(401,15);
	btnSelectAll1.Click += new EventHandler(btnSelectAll1_Click);
	btnSelectAll1.TabIndex = 6;
	GroupBox___Sub_module_journals.Controls.Add(btnSelectAll1);
	Button btnDeSelectAll1 = new Button();
	btnDeSelectAll1.Text = DeselectAll;
	btnDeSelectAll1.Location = new Point(401,40);
	btnDeSelectAll1.TabIndex = 7;
	btnDeSelectAll1.Click += new EventHandler(btnDeSelectAll1_Click);	
	GroupBox___Sub_module_journals.Controls.Add(btnDeSelectAll1);


}

 private void btnSelectAll_Click(object sender, EventArgs e)
{
	chkPrintNormalJournals.Checked = true;
	chkPrintProvisionalJournals.Checked = true;
	chkPrintUserDefinedJournals.Checked = true;
	chkPrintInterCompanyJournals.Checked = true;
	chkPrintAlternateCurrencyJournals.Checked = true;
	chkPrintStatisticalJournals.Checked = true;
	chkPrintAuditorsAdjustments.Checked = true;
	chkPrintPeriodEndAdjustments.Checked = true;
}
private void btnDeSelectAll_Click(object sender, EventArgs e)
{
	chkPrintNormalJournals.Checked = false;
	chkPrintProvisionalJournals.Checked = false;
	chkPrintUserDefinedJournals.Checked = false;
	chkPrintInterCompanyJournals.Checked = false;
	chkPrintAlternateCurrencyJournals.Checked = false;
	chkPrintStatisticalJournals.Checked = false;
	chkPrintAuditorsAdjustments.Checked = false;
	chkPrintPeriodEndAdjustments.Checked = false;

}
private void btnSelectAll1_Click(object sender, EventArgs e)
{
	chkPrintApInvoiceJournals.Checked = true;
	chkPrintApPaymentJournals.Checked = true;
	chkPrintArInvoiceJournals.Checked = true;
	chkPrintArCashJournals.Checked = true;
	chkPrintAssetJournals.Checked = true;
	chkPrintCashbookJournals.Checked = true;
	chkPrintWipPartBillingJournals.Checked = true;
	chkPrintWipLaborJournals.Checked = true;
	chkPrintTpmJournals.Checked = true;
	chkPrintInventoryJournals.Checked = true;
	chkPrintGrnJournals.Checked = true;
}
private void btnDeSelectAll1_Click(object sender, EventArgs e)
{
	chkPrintApInvoiceJournals.Checked = false;
	chkPrintApPaymentJournals.Checked = false;
	chkPrintArInvoiceJournals.Checked = false;
	chkPrintArCashJournals.Checked = false;
