	chkPrintCashbookJournals.Checked = false;
	chkPrintWipPartBillingJournals.Checked = false;
	chkPrintWipLaborJournals.Checked = false;
	chkPrintTpmJournals.Checked = false;
	chkPrintInventoryJournals.Checked = false;
	chkPrintGrnJournals.Checked = false;


}


//Function for rbType1_CheckedChanged
public void rbType1_CheckedChanged ()
{
	if (rbType1.Checked)
	{
		GroupBox___Standard_journal_selection.Enabled = true;
		GroupBox___Recurring_journal_selection.Enabled = false;
		GroupBox___Normal_journal_selection.Enabled = false;
		grpRecurringAuthJournals.Enabled = false;
		GroupBox___Ledge_year_selection.Enabled = false;
		GroupBox___Period_selection.Enabled = false;
		grpAuthorizedJournals.Enabled = false;
		GroupBox___Journal_type_selection.Enabled = false;
		GroupBox___Journal_status_selection.Enabled = false;
		GroupBox___Sub_module_journals.Enabled = false;
	}
}
//Function for rbType2_CheckedChanged
public void rbType2_CheckedChanged ()
{
	if (rbType2.Checked)
	{
		GroupBox___Standard_journal_selection.Enabled = false;
		GroupBox___Recurring_journal_selection.Enabled = true;
		GroupBox___Normal_journal_selection.Enabled = false;
		grpRecurringAuthJournals.Enabled = true;
		GroupBox___Ledge_year_selection.Enabled = false;
		GroupBox___Period_selection.Enabled = false;
		grpAuthorizedJournals.Enabled = false;
		GroupBox___Journal_type_selection.Enabled = false;
		GroupBox___Journal_status_selection.Enabled = false;
		GroupBox___Sub_module_journals.Enabled = false;
	}
}
//Function for cboJournalNumberSelection_SelectedIndexChanged
public void cboJournalNumberSelection_SelectedIndexChanged ()
{
	if (cboJournalNumberSelection.SelectedIndex == 0)
		{
			txtSFromJournalNumber1.Enabled = false;
			Button___Blank.Enabled = false;
			txtSToJournalNumber1.Enabled = false;
			brwSToJournalNumberGenJournalCtl.Enabled = false;
		}
	else
		{
			Label___From.Enabled = true;
			txtSFromJournalNumber1.Enabled = true;
			Button___Blank.Enabled = true;
			txtSToJournalNumber1.Enabled = true;
			brwSToJournalNumberGenJournalCtl.Enabled = true;
		}
}
//Function for cboRecurringJournalSelection_SelectedIndexChanged
public void cboRecurringJournalSelection_SelectedIndexChanged ()
{
	if (cboRecurringJournalSelection.SelectedIndex == 0)
	{
			txtSRecurringFrom1.Enabled = false;
			brwSRecurringFromGenRecJnlCtl.Enabled = false;
			txtSRecurringTo1.Enabled = false;
			brwSRecurringToGenRecJnlCtl.Enabled = false;
	}
	else
		{
			txtSRecurringFrom1.Enabled = true;
			brwSRecurringFromGenRecJnlCtl.Enabled = true;		
			txtSRecurringTo1.Enabled = true;
			brwSRecurringToGenRecJnlCtl.Enabled = true;
		}
}
//Function for cboStandardJournalSelection_SelectedIndexChanged
public void cboStandardJournalSelection_SelectedIndexChanged ()
{
	if (cboStandardJournalSelection.SelectedIndex == 0)
		{
			txtSStandardFrom1.Enabled = false;
			brwSStandardFromGenStdJnlCtl.Enabled = false;
			txtSStandardTo1.Enabled = false;
			brwSStandardToGenStdJnlCtl.Enabled = false;
		}
	else
		{
			txtSStandardFrom1.Enabled = true;
			brwSStandardFromGenStdJnlCtl.Enabled = true;
			txtSStandardTo1.Enabled = true;
			brwSStandardToGenStdJnlCtl.Enabled = true;	
		}
}
//Function for cboPeriodSelection_SelectedIndexChanged
public void cboPeriodSelection_SelectedIndexChanged ()
{
	if (cboPeriodSelection.SelectedIndex == 0)
		{
			cboLedgerPeriod.Enabled = false;
		}
else
{
	if (cboPeriodSelection.SelectedIndex == 1)
		{	
			cboLedgerPeriod.Enabled = true;
			int myInt = int.Parse(GenCurrentMonth);
			myInt = myInt -1;
			cboLedgerPeriod.SelectedIndex = myInt;
		}
}
}
